        }else{
            $('#noOri').val(1);
            $('#defOri').val('ori0');

            $('.case.sp input[type=checkbox]:not(.stop)').prop('checked',true);
            $('.case.sp input[name="isDefault"]').val(0);

        }
        //$('.case.sp input.blackHole').change();


    //est ce que j'ai cliqu sur une situation ? (sp)
    }else if ( obj.parents('span.sp').length != 0 ) {

