            $('#noOri').val(0);//je veux que l'origine soit gr
            $defaultOri = $('.case input[name="defaultOri"]').val();
            $savOri		= $('#savOri').val();

            $('#defOri').val($defaultOri || $savOri);//on rtablie l'origine par defaut !PB actuel
            $('#etOri').prop('checked',false);

            //$('.case.sp	.sp		input[type=checkbox]:not(.stop),.case.sp .spd	input').prop('checked',false);

            //n'agit que sur spd

            $('.case.sp .spd	input,.case.sp .sp	input').prop('checked',false);
            $('.case.sp	.sp		input[type=checkbox]:not(.stop)').prop('indeterminate',false);
            $('.case.sp			input[name="isDefault"]').val(1);
        }

    }


    $('form.moteurPoi').change();
}
var ajaxManager = (function() {
     var requests = [];
     var xhrs = [];

     return {
        abortAllReq : function(){
            requests = [];
            xhrs.forEach(function(item,index){
                item.abort();
            })
        },
        addReq:  function(opt) {
            requests.push(opt);
        },
        removeReq:  function(opt) {
            if( $.inArray(opt, requests) > -1 )
                requests.splice($.inArray(opt, requests), 1);
        },
        run: function() {
            var self = this,
                oriSuc;

            if( requests.length ) {
                oriSuc = requests[0].complete;

                requests[0].complete = function() {
                     if( typeof(oriSuc) === 'function' ) oriSuc();
                     requests.shift();
                     self.run.apply(self, []);
                };
                //console.debug(requests);
                xhrs[0] = $.ajax(requests[0]);
            } else {
              self.tid = setTimeout(function() {
                 self.run.apply(self, []);
              }, 1000);
            }
        },
        stop:  function() {
            requests = [];
            clearTimeout(this.tid);
        }
     };
}());
$(function(){
    ajaxManager.run();
})

