// moteur + thematique
$(function(){



    $(document).on('change','.contenu-poi-zone .blackHole,.listeMoteur .blackHole',function(e){
        state 	= $(this).prop("checked");
        dad 	= $(this).parents('.listeMoteur');
        childs 	= dad.find('input:not(.blackHole)');
        $(childs).prop("checked",state);
        dad.find('input:not(.blackHole).stop').prop("checked",!state);
        if(!state){
            //$(this).prop("checked",false).prop("indeterminate", false);
            e.preventDefault();
            e.stopPropagation();
        }
    })

    $(document).on('click','.filtre-contenu .button_input',function(e){
        e.preventDefault();
        $(this).parents('form').change();
    })
    $(document).on('keydown','.filtre-contenu input[type=text]',function(e){
        if(e.keyCode == 13) {
            $(this).change();
            $(this).parents('form').change();
        }
    })

    $(document).on('click','.contenu-poi-zone input:not(.blackHole)[type!=text],.listeMoteur input:not(.blackHole)[type!=text]',function(){
        dad		 = $(this).parents('.listeMoteur');
        childs	 = dad.find('input:not(.blackHole):not(.stop)');
        theChild = dad.find('input.blackHole');
        var countTrue=0,countFalse = 0;
        $.each(childs , function( idx,child) {
            if($(child).prop("checked"))
                countTrue++;
            else
                countFalse++;
        });
        if(countFalse==0){
            theChild.prop("checked",true).prop("indeterminate", false);
        }else if(countTrue==0){
            theChild.prop("checked",false).prop("indeterminate", false);
        }else{
            theChild.prop("checked",false).prop("indeterminate", true);
        }

    })
    //infinite load
    $(document).on('click','.boutonListingPoi a,.boutonListingPoi-m a',function(e){
        e.preventDefault();
        //console.log($(this).attr('href'));
        $.get($(this).attr('href') + '&render_mode=ajax').success(function(html){
            nextPosition = $('.listingPOI:last li:last');
            hasMotor = $('ul.listingPOI').attr('data-motor');
            //console.log(hasMotor);

            $('[data-label]',html).each(function(){
                container =  $('[data-label="'+$(this).data('label')+'"]')
                if(container.length==1){
                    container.find('ul.listingPOI').append($(this).find('ul.listingPOI li'))
                }else{
                    $('div.listepoi').append($(this));
                }

            })
            //$('ul.listingPOI').append($('.listingPOI li',html));
            position = nextPosition.offset().top;
            if(hasMotor==1){
                position = position + $('.listepoi-blocs').scrollTop() - $('.listepoi-blocs').offset().top ;
                $('.listepoi-blocs').animate({scrollTop: position});
            }else{
                $('html, body').animate( { scrollTop: position  }, 400 );

            }
            $('.boutonListingPoi').empty().append($('.boutonListingPoi a',html));
            $('.boutonListingPoi-m').empty().append($('.boutonListingPoi-m a',html));
        })
    })

    if($(window).width()<620){
        $('.contenu-poi1 .closeTheDoor a').click();
        $('.criteres-poi').hide();
        $('#thematiques-poi').hide();
    }

    $(document).on('change','form.moteurPoi',function(e){
        if(!$(e.target).hasClass('noReload')){ // Disabled ajax when date and persons change
            $('#listepoi-criteres-attente,#listepoi-criteresp-attente').show();
            form = $(this);
            ajaxManager.abortAllReq();
            ajaxManager.abortAllReq();
            url = form.attr('data-update');
            var d= new Date($( "#datepickerDeb" ).val());
            var d2= new Date($( "#datepickerFin" ).val());
            if ( !isNaN(d.getTime()) && !isNaN(d2.getTime())){
                if(d2.getTime()<d.getTime()) {
                    $( "#datepickerFin" ).val($( "#datepickerDeb" ).val());
                }
            }
            $('.ajaxLoading').html('<p align="center">CHARGEMENT / LOADING<br /><img src="/images/ajax-loader.gif"></p>');
            ajaxManager.addReq({
                data: form.serialize()
                , dataType: 'html'
                , type: 'get'
                , url: url
                , success: function(resultat) {
                    $('.ajaxReload').html($('.ajaxReload',resultat).html())
                    $('.colonneMoteur').html($('.colonneMoteur',resultat).html())
                    $('.colonneListing').html($('.colonneListing',resultat).html())
                    $('.colonneCarte').html($('.colonneCarte',resultat).html())
                    $('#myModalRR').html($('#myModalRR',resultat).html())

                    $('#listepoi-criteres-attente,#listepoi-criteresp-attente').hide();
                    $( "#datepickerFin" ).datepicker({ minDate: $( "#datepickerDeb" ).val(),altField: "#datepickerFinopen",altFormat: "d MM yy", onClose:function () { $('#datepickerFinopen').parent().height(0);} });
                    $( "#datepickerDeb" ).datepicker({altField: "#datepickerDebopen",altFormat: "d MM yy", onClose:function () { $('#datepickerDebopen').parent().height(0);}});
                    $( "#datepickerFin" ).datepicker('option', 'firstDay', 1);
                    $( "#datepickerDeb" ).datepicker('option', 'firstDay', 1);
                    $('.listepoi-event').html($('.listepoi-event',resultat).html());
                    if (typeof initialize === "function") {
                        initialize();
                    }
                }
            });//fin $.ajax()
	    ajaxManager.run();
        }
    })

    $(document).on('change','.case.spd input',function(e){
        majSitDest();
    })

})
$(function(){
var ellipsisText = function (e, etc) {
    var wordArray = e.innerHTML.split(" ");
    while (e.scrollHeight > e.offsetHeight) {
        wordArray.pop();
        e.innerHTML = wordArray.join(" ") + (etc || "...");
    }
};
[].forEach.call(document.querySelectorAll(".ellipsisText"), function(elem) {
    ellipsisText(elem);
});
})


